import React from 'react'
import { Link, NavLink } from "react-router-dom";

function SignedInLink() {
    return (
      <Nav>
        <Nav.Link href="#deets">
          <Button variant="light">
            <IoMdPerson /> Sign Up
          </Button>
        </Nav.Link>
        <Nav.Link href="#memes">
          <Button variant="light">
            <IoIosLogIn /> Login
          </Button>
        </Nav.Link>
      </Nav>
    );
}
 export default SignedInLink;
